import React from "react";
import { motion } from 'framer-motion';
import * as ReactDOMClient from 'react-dom/client';

const BOX_WIDTH = 200;
const BOX_HEIGHT = 200;
const INITIAL_ROWS = 3;
const COLUMNS = 3;

function generateRandomPositionInBox() {
  const top = Math.floor(Math.random() * (BOX_HEIGHT - 100)); // Adjust for button height
  const left = Math.floor(Math.random() * (BOX_WIDTH - 100)); // Adjust for button width
  return { top, left };
}

function generateRandomScale() {
  return 1 + Math.random() * 0.5; // Random scale between 1 and 1.5
}

function PulsatingButton({ text }) {
  const [position] = useState(generateRandomPositionInBox);
  const [scale] = useState(generateRandomScale); // Random scale factor

  return (
    <motion.button
      style={{
        position: 'absolute',
        top: position.top,
        left: position.left,
        width: 100,
        height: 100,
        borderRadius: '50%',
        backgroundColor: '#1A06D0',
        color: 'white',
        fontSize: '16px',
        fontWeight: 'bold',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        border: 'none',
        cursor: 'pointer',
        outline: 'none',
      }}
      animate={{
        scale: [1, scale, 1], // Apply random scale factor in animation
      }}
      transition={{
        duration: 5,
        ease: 'easeInOut',
        repeat: Infinity,
      }}
      whileHover={{ scale: scale + 0.1 }} // Slightly increase scale on hover
      onClick={() => alert(`${text} clicked!`)}
    >
      {text}
    </motion.button>
  );
}

function AppWithUI() {
  const [rows, setRows] = useState(INITIAL_ROWS); // Initially display 3 rows of buttons
  const [searchTerm, setSearchTerm] = useState(''); // State for search bar input

  // Function to handle the search bar input
  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value); // Update search term
  };

  // Add a new row of buttons when the "Add Circle" button is clicked
  const addCircleRow = () => {
    setRows((prevRows) => prevRows + INITIAL_ROWS); // Add more rows of circles
  };

  return (
   <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 20 }}>
      {/* Header with Search Bar */}
      <header style={{ width: '100%', padding: '20px', backgroundColor: '#2c3e50', color: 'white', textAlign: 'center' }}>
        <input
          type="text"
          value={searchTerm}
          onChange={handleSearchChange}
          placeholder="Search..."
          style={{
            padding: '10px',
            width: '50%',
            fontSize: '16px',
            borderRadius: '5px',
            border: 'none',
            outline: 'none',
          }}
        />
      </header>

      {/* Body with Circles */}
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 20 }}>
        {Array.from({ length: rows }).map((_, rowIndex) => (
          <div key={rowIndex} style={{ display: 'flex', gap: 20 }}>
            {Array.from({ length: COLUMNS }).map((_, colIndex) => (
              <div
                key={colIndex}
                style={{
                  position: 'relative',
                  width: BOX_WIDTH,
                  height: BOX_HEIGHT,
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                }}
              >
                <PulsatingButton text={`Button ${rowIndex * COLUMNS + colIndex + 1}`} />
              </div>
            ))}
          </div>
        ))}
      </div>

      {/* Footer with "Add Circle" Button */}
      <footer style={{ width: '100%', padding: '20px', backgroundColor: '#2c3e50', color: 'white', textAlign: 'center' }}>
        <button
          onClick={addCircleRow}
          style={{
            padding: '10px 20px',
            fontSize: '16px',
            backgroundColor: '#3498db',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
          }}
        >
          Add Circle
        </button>
      </footer>
    </div>
  );
}

const rootElement = document.getElementById("root");
const root = ReactDOMClient.createRoot(rootElement);
root.render(<AppWithUI />);


const Hero = () => {
    return (
        <section>
            Test
        </section>
    );
}

const Home = () => {
    return <>
        <Hero />
    </>;
}

export default Home;
